UPDATE master."template" SET "name"='List of registration centers', descr='List of registration centers', file_format_code='html', model='velocity', file_txt='<html>  <head> <meta charset=UTF-8> <meta name=viewport content=width=device-width, initial-scale=1.0> <meta http-equiv=X-UA-Compatible content=ie=edge> <title>registration centers</title> </head>  <body lang=EN-US style=''word-wrap: break-word''>  <p class=MsoNormal align=center style=''text-align:center''><span lang=EN-IN><img width=200 height=100 id=Picture 2 src=https://mosip.io/images/logo.png alt=MOSIP></span></p>  <p class=MsoNormal align=center style=''text-align: center''> <b><span style=''font-size: 16.0pt; line-height: 106%; font-family: Arial, sans-serif; color:#1D1C1D; background: yellow''>Registration centers</span></b> </p>  <p class=MsoNormal align=center style=''text-align: center''>&nbsp;</p>  <table class=MsoTableGrid border=1 cellspacing=0 cellpadding=0 width=737 style=''width:90%;margin:auto;border-collapse: collapse;''> <tr> <td width=104 valign=top style=''width: 78.0pt; border: solid windowtext 1.0pt; padding: 0in 5.4pt 0in 5.4pt''> <p class=MsoNormal align=center style=''margin-bottom: 0in; text-align: center; line-height: normal''> <b>Serial number</b> </p> </td> <td width=104 valign=top style=''width: 78.0pt; border: solid windowtext 1.0pt; border-left: none; padding: 0in 5.4pt 0in 5.4pt''> <p class=MsoNormal align=center style=''margin-bottom: 0in; text-align: center; line-height: normal''> <b>Registration center name</b> </p> </td> <td width=104 valign=top style=''width: 78.0pt; border: solid windowtext 1.0pt; border-left: none; padding: 0in 5.4pt 0in 5.4pt''> <p class=MsoNormal align=center style=''margin-bottom: 0in; text-align: center; line-height: normal''> <b>Registration center address</b> </p> </td> <td width=104 valign=top style=''width: 78.0pt; border: solid windowtext 1.0pt; border-left: none; padding: 0in 5.4pt 0in 5.4pt''> <p class=MsoNormal align=center style=''margin-bottom: 0in; text-align: center; line-height: normal''> <b>Contact number</b> </p> </td> <td width=104 valign=top style=''width: 78.0pt; border: solid windowtext 1.0pt; border-left: none; padding: 0in 5.4pt 0in 5.4pt''> <p class=MsoNormal align=center style=''margin-bottom: 0in; text-align: center; line-height: normal''> <b>Days of week | Timings</b> </p> </td> </tr> #foreach($dto in $regCenterIntialList) <tr> <td width=104 valign=top style=''width: 78.0pt; border: solid windowtext 1.0pt; padding: 0in 5.4pt 0in 5.4pt''> <p class=MsoNormal align=center style=''margin-bottom: 0in; text-align: center; line-height: normal''> <span>$dto.serialNumber</span> </p> </td> <td width=104 valign=top style=''width: 78.0pt; border: solid windowtext 1.0pt; border-left: none; padding: 0in 5.4pt 0in 5.4pt''> <p class=MsoNormal align=center style=''margin-bottom: 0in; text-align: center; line-height: normal''> <span>$dto.name</span> </p> </td> <td width=104 valign=top style=''width: 78.0pt; border: solid windowtext 1.0pt; border-left: none; padding: 0in 5.4pt 0in 5.4pt''> <p class=MsoNormal align=center style=''margin-bottom: 0in; text-align: center; line-height: normal''> <span>$dto.fullAddress</span> </p> </td> <td width=104 valign=top style=''width: 78.0pt; border: solid windowtext 1.0pt; border-left: none; padding: 0in 5.4pt 0in 5.4pt''> <p class=MsoNormal align=center style=''margin-bottom: 0in; text-align: center; line-height: normal''> <span>$dto.contactPhone</span> </p> </td> <td width=104 valign=top style=''width: 78.0pt; border: solid windowtext 1.0pt; border-left: none; padding: 0in 5.4pt 0in 5.4pt''> <p class=MsoNormal align=center style=''margin-bottom: 0in; text-align: center; line-height: normal''> <span>$dto.workingHours</span> </p> </td> </tr> #end </table> <br /><br /><br /><br /><br /><br /><br /><br /><br /><br /> </body>  </html>', module_id='10006', module_name='Resident Services', template_typ_code='registration-centers-list', is_active=true, cr_by='superadmin', cr_dtimes=now(), upd_by=NULL, upd_dtimes=NULL, is_deleted=false, del_dtimes=NULL WHERE template_typ_code='registration-centers-list' AND lang_code='eng';
